pragma solidity 0.6.9;


pragma experimental ABIEncoderV2;

library CoreLibrary {

	struct Account {
		uint256 vaultCounter;
		Vault[] vaults;
	}

	struct Vault {
    uint256 a;
    uint256 b;
  }

	function updateVault(Account storage _self, uint256 id, uint256 a, uint256 b) external {
		require(_self.vaultCounter >= id, "error 1");

    Vault storage vault = _self.vaults[id];

		vault.a = a;
		vault.b = b;
  }

	function initVault(Account storage _self, uint256 a, uint256 b) external {
		Vault memory vault = Vault(a, b);

		_self.vaultCounter++;
		_self.vaults.push(vault);
	}

	function getVault(Account storage _self, uint256 id) external view returns (Vault memory) {
    Vault memory vault = _self.vaults[id];

		return vault;
  }


}
